import React from 'react';

const ProductCard = ({ product }) => {
  return (
    <div>
      <h2>{product.nombre}</h2>
      <p>{product.descripcion}</p>
      <p>${product.precio}</p>
      <button>Agregar al carrito</button>
    </div>
  );
};

export default ProductCard;
